import React from 'react';
import {Link} from 'react-router-dom';

const Nav = props => {
  return (
    <header>
      <h1>WeEat</h1>
      <nav>
        <Link to='/' >Home</Link>
      </nav>
    </header>
  )
}

export default Nav;
